        "description": "\u003cb\u003eA Job Before Graduation&nbsp;\u003c/b\u003e\u003cbr\u003e\u003cbr\u003eYouTube Link:\u003ca href=\"https://youtu.be/WX6JTl3-YUY\"\u003ehttps://youtu.be/WX6JTl3-\u003cwbr\u003eYUY\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e\u003cb\u003eSpeaker Profile:&nbsp;\u003c/b\u003e\u003cbr\u003e\u003cb\u003e\u003cbr\u003e\u003c/b\u003e\u003cbr\u003eMr. Gokul SanthanamSenior Vice President &amp; Global BU HR HeadMphasis Limited&nbsp;\u003cbr\u003e\u003cbr\u003e&nbsp;Mr. Gokul Santhanam is currently associated with Mphasis as their Senior Vice-President. He heads the Global Business HR function for twenty-eight thousand employees spread across 16 countries. Prior to MphasiS, he was a part of the management team of Tata Business Support Services and was one of the youngest Vice Presidents of a Tata Group Company.Gokul is an Electronics and Communications engineer from SVCE, Madras University and a MBA in HR from XIME, Bangalore. He has been working for the last two decades in the areas of Human Resource Management and Organization Development. He is popular amongst the HR fraternity and is a regular speaker in HR conferences, engineering colleges and management institutes. As a proponent of eco-travel and going-green, Gokul has cycled over 2500 km across Tamilnadu to promote the cause of cycling. He loves traveling, photography and meeting new people. Gokul has authored a bestseller, Management Lessons from Movies. His third book, A Job Before Graduation was released recently. Gokul is also a founder trustee of The Social Catalyst, a non-profit trust. The purpose of this trust is to support smaller NGOs who are struggling to sustain their good work due to various external factors.&nbsp;",
