        "summary": "Industrial Session",
        "description": "\u003cbr\u003e\u003cb\u003eSpeaker Name\u003c/b\u003e- Mr.&nbsp;Swaminathan N\u003cbr\u003e\u003cb\u003eSpeaker designation\u003c/b\u003e-&nbsp;&nbsp;Associate Vice President,&nbsp;HCL Technologies Ltd.\u003cbr\u003e\u003cb\u003eSession Topic\u003c/b\u003e-&nbsp;&nbsp;O2E (Order to Execution) Cycle and Software Project Roles and Skills\u003cbr\u003e\u003cb\u003e\u003cbr\u003e\u003c/b\u003e\u003cbr\u003e\u003cb\u003eTime and date\u003c/b\u003e-&nbsp; Jan 29th at 6 pm\u003cbr\u003e\u003cbr\u003eYouTube link -&nbsp;\u003ca href=\"https://youtu.be/qvpUf2oq4V8\" id=\"ow728\" __is_owner=\"true\"\u003ehttps://youtu.be/qvpUf2oq4V8\u003c/a\u003e\u003cbr\u003e\u003cp\u003e\u003cb\u003eSummary\u003c/b\u003e:&nbsp;The topic is divided into 3 streams. Stream #1 gives an overview of the trends and how this impacts IT industry. Stream #2 talks about he O2E (Order To Execution) Cycle and the type of projects that flow into the sector. Stream #3 relates the skills of the B.Sc students and gives tips on how to upskill themselves and takes advantage of the course in order to become more employable.\u003c/p\u003e\u003cp\u003e\u003cb\u003eSpeaker Profile\u003c/b\u003e:&nbsp;Mr Swaminathan is 30+ years experienced professional in Consulting and IT delivery and solutioning services. For the last 17+ years, he has been with HCL working as the solutions head for EMEA region for Financial Services. As part of this, he helps in strategy formulation to maximize growth. His responsibilities include identification of strategic opportunities, generation of underlying business case and management of all opportunities/proposals in the EMEA region planning to realization. He works with customers (CxOs), sales team and delivery team. Prior to this role, he had served in various capacities in in India and abroad like Program Manager, Regional Delivery Centre Head, Business Unit Delivery Head etc. He was selected as one of the CEO Champions in 2014 for his contribution to the growth of Financial Services Sector.&nbsp;\u003c/p\u003e\u003cp\u003eLinkedIn profile:&nbsp;\u003ca href=\"https://www.linkedin.com/in/swaminathan-nagarajan-51186b8/\" id=\"ow708\" __is_owner=\"true\"\u003ehttps://www.linkedin.\u003cwbr\u003ecom/in/swaminathan-nagarajan-\u003cwbr\u003e51186b8/\u003c/a\u003e\u003c/p\u003e",
