        "description": "Speaker Name-&nbsp;Mr BOB &nbsp;PAUL RAJ and Dr SHANKAR VENUGOPAL \"\u003cbr\u003eSpeaker designation-&nbsp;&nbsp;\"PRINCIPAL ENGINEER CONNECTED &nbsp;&amp; DIGITAL PLATFORMS and Vice President - Mahindra &amp; Mahindra\u003cbr\u003eSession Topic-&nbsp;&nbsp;Introduction to Connected Vehicle Technology\u003cbr\u003eTime and date- 29th Jan 2021&nbsp;@ 6pm\u003cbr\u003e\u003cp\u003e\u003cb\u003e\u003cbr\u003e\u003c/b\u003e\u003c/p\u003e\u003cp\u003e\u003cb\u003eYouTube Link: https://youtu.be/MX6aEkcFu6U\u003c/b\u003e\u003c/p\u003e\u003cp\u003e\u003cb\u003eSpeaker Profile\u003c/b\u003e:&nbsp;&nbsp;Name : Bob Paul Raj\u003c/p\u003eHead of Connected and Digital Platforms\u003cbr\u003eMahindra &amp; Mahindra at Mahindra Research Valley , Chennai.\u003cbr\u003eQualification : BE (E&amp;C); MS (by Research); PGDPM&amp;LL\u003cbr\u003eExperience : Overall 21 years of experience in Product development &amp; R&amp;D organisations like Tata Elxsi , Sasken &amp; Hyundai Mobis which includes an Entrepreneurial venture .\u003cbr\u003eA Short Note\u003cbr\u003e- A Technology Visionary , Strategeist &amp; Speaker who have always been involved in delivering various game changing Products in the area of Cockpit Electronics, Infotainment, Consumer Electronics and Connected Platforms.\u003cbr\u003e- Built the Next Generation Connected solutions for Farm Equipments from Device to Cloud Data platform. The solution was able to enhance Customer Experience &amp; Delight by onboarding variety of Applications. Built Data Models delivering Insights for Engineering, Service &amp; Marketing Teams.\u003cbr\u003e- Successful in carving out Key partnerships in the Connected Ecosystem for delivering the Vehicle IOT platform\u003cbr\u003e- Have been involved in delivering mass Infotainment products deployed Globally in over 100 different car models with more than 15 million units on the road and growing.\u003cbr\u003e- Have been instrumental in building Strong &amp; Agile Technology &amp; SW Teams with both Offshore and onsite models. Strategised flexible delivery models to ensure rapid Go to Market strategies &amp; Mass deployment.\u003cbr\u003e- Host of Technical publications &amp; 4 Patents in the area of Connected solutions.\u003cbr\u003e\u003cbr\u003eHave always Challenged the Limits\u003cbr\u003e\u003cbr\u003eProfile of Dr Shankar\u003cbr\u003eDr Shankar leads technology innovation for the Automotive &amp; Farm services business (AFS). He heads the intellectual property (Patents) and knowledge management functions. He is also the Dean of the Mahindra Technical Academy. Shankar is passionate about developing sustainable urban mobility solutions and his current interests span across electric vehicles, connected vehicles, autonomous vehicles and precision farming. Prior to joining Mahindra &amp; Mahindra, Shankar has held technology innovation leadership roles at GE, Dow, Honeywell and Cummins. He holds ten international patents and numerous new product innovation awards. He has developed a proprietary innovation methodology  Innovation FLOW  and trained 1000 + inventors and innovators. Shankar obtained a Ph.D in Materials Science and a gold medal for the best doctoral thesis from the Indian Institute of Science, Bangalore. He completed his executive management program from the Indian Institute of Management, Bangalore. Shankar is an avid reader and is interested in physics, philosophy and psychology. He teaches technology innovation management at premier engineering &amp; management institutes in India &amp; abroad.",
