        "description": "\u003cbr\u003e\u003cbr\u003eSend your questions:&nbsp;\u003ca href=\"https://forms.gle/YVpJfRea4Bk4F3ZU9\"\u003ehttps://forms.gle/YVpJfRea4Bk4F3ZU9\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e\u003cb\u003eWebex Meeting:\u003cbr\u003e\u003c/b\u003e\u003ca href=\"https://iitmadras.webex.com/iitmadras/j.php?MTID=mb94fb125bd116b90648a46312e064a33\"\u003ehttps://iitmadras.webex.com/\u003cu\u003e\u003c/u\u003eiitmadras/j.php?MTID=\u003cu\u003e\u003c/u\u003emb94fb125bd116b90648a46312e064\u003cu\u003e\u003c/u\u003ea33\u003c/a\u003e\u003cbr\u003e\u003cbr\u003e\u003cb\u003eYoutube live session link:\u003c/b\u003e\u003cbr\u003e\u003ca href=\"https://youtu.be/EBtAE4H6ChI\"\u003ehttps://youtu.be/EBtAE4H6ChI\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eFriday, Jan 29, 2021 7:25 pm | 2 hours | (UTC+05:30) Chennai, Kolkata, Mumbai, New Delhi\u003cbr\u003e\u003cbr\u003eMeeting number: 158 872 7754\u003cbr\u003e\u003cbr\u003ePassword: 12345\u003cbr\u003e\u003cbr\u003eLive session feedback:&nbsp;\u003ca href=\"http://bit.ly/t1lsf\"\u003ehttp://bit.ly/t1lsf\u003c/a\u003e\u003cbr\u003e\u003cbr\u003eDescription:\u003cbr\u003e\u003cbr\u003e\u003cb\u003eTogether - We will be solving 5 or 6 problems which will be very similar to questions in Week 7 graded assignment (due for submission on 31 Jan, Sunday, 2359 hrs).\u003c/b\u003e\u003cbr\u003e\u003cb\u003eProf Andrew Thangaraj, Coordinator of IITM Online degree project, will be handling the Maths session tomorrow, Friday, 29 Jan 2021, timing 7.30pm to 9pm. Link is given in your course calendar.\u003c/b\u003e\u003cbr\u003e\u003cbr\u003eWe will take a problem, with some hints given, and give 5mins to solve the problem. Once done, we will discuss the solution and open out for doubts/questions. We hope to solve 6 problems tomorrow, which are all similar to the week 7 graded assignment questions.&nbsp;\u003cbr\u003e\u003cbr\u003eWe wish to see if such sessions will help learners who have difficulties with the graded assignments and we will decide on continuing this in further weeks based on feedback received. This is only a trial - so ignore the hiccoughs and teeting issues that might be there.&nbsp;\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003e\u003cbr\u003eOrganizer: Mathema",
