        "description": "\u003cb\u003eAbout the session\u003c/b\u003e-&nbsp;&nbsp;&nbsp;The topic involves the evolution of cloud computing to hybrid cloud and the emergence of edge computing than ever before. This lecture will cover the details of these concepts, use cases, and involved technology overview.\u003cbr\u003e\u003cbr\u003e\u003cb\u003eSpeaker Profile:&nbsp;\u003c/b\u003e&nbsp;Ms.&nbsp;Kamitha Jairaj&nbsp;works as an engagement lead, for India Software Lab, IBM.&nbsp;She holds a master's degree (MBA) in human resource and personnel management from Symbiosis university and had joined IBM 12 years back as a fresher.\u003cbr\u003eShe has held many portfolios at India Software Lab, from Asset Management, Resource Deployment, and is now currently leading the Success skill learning Programs for the lab.\u003cbr\u003eAn IBM recognized speaker and a mentor, she enjoys storytelling and has successfully conceptualized and curated an all virtual learning program called CATAPULT - Get A Head Start for the lab during the covid times.\u003cbr\u003e\u003cbr\u003e\u003cb\u003eDate\u003c/b\u003e: 3rd June (Tomorrow)\u003cbr\u003e\u003cbr\u003e\u003cb\u003eTiming\u003c/b\u003e&nbsp;: 6:00 PM - 7:00 PM\u003cbr\u003e\u003cbr\u003e\u003cb\u003eYouTube link :&nbsp;&nbsp;\u003c/b\u003e&nbsp;&nbsp;\u003ca href=\"https://youtu.be/-lLRxv3h5co\"\u003ehttps://youtu.be/-\u003cu\u003e\u003c/u\u003elLRxv3h5co\u003c/a\u003e",
