        "summary": "Industry Session",
        "description": "\u003cp\u003e\u003cb\u003eAbout the session-\u003c/b\u003e&nbsp;&nbsp;&nbsp;In today's world data is the new currency and the booming of Cloud has changed the way enterprises run their business. We will take a look at how the cloud has evolved and the recent trends in cloud computing.\u003c/p\u003e\u003cp\u003e\u003cb\u003eSpeaker Profile\u003c/b\u003e:&nbsp;He&nbsp;works as an Architect/Tech Lead in IBM Cloud Storage India team. Previously played a role of an Architect for Mobile Foundation Service on IBM Cloud. As a hands-on Cloud Architect, He has worked on Cloud Native Kubernetes based microservices architecture, Application Security, ensuring adherence to IBM Cloud compliance standards. As a passionate developer, He likes patenting, presenting in conferences and he is currently pursuing PhD in Microservices Architectural patterns. While he is passionate about technology, he finds happiness in mentoring and learning.&nbsp;&nbsp;\u003c/p\u003e\u003cp\u003e\u003cb\u003eDate\u003c/b\u003e: 9th June (Tomorrow)\u003c/p\u003e\u003cp\u003e\u003cb\u003eTiming\u003c/b\u003e&nbsp;: 6:00 PM - 7:00 PM\u003c/p\u003e\u003cb\u003eYouTube link\u003c/b\u003e :\u003ca href=\"https://youtu.be/HCLtIzdQXNg\"\u003ehttps://youtu.be/HCLtIzdQXNg\u003c/a\u003e",
