        "summary": "Industry Session",
        "description": "\u003cb\u003eSpeaker Name\u003c/b\u003e- Mr.Rajeev Palanki\u003cbr\u003e\u003cb\u003eSpeaker designation\u003c/b\u003e-&nbsp;&nbsp;Leader, Employee Experience, IBM India Software Labs\u003cbr\u003e\u003cb\u003eSession Topic\u003c/b\u003e-&nbsp; 'Career advice to my younger self'\u003cbr\u003e\u003cb\u003eTime and date\u003c/b\u003e-&nbsp; June 17th 6.00 pm\u003cbr\u003e\u003cp\u003e\u003cb\u003eSummary\u003c/b\u003e:&nbsp;&nbsp;-&nbsp;He will look back at learning and experiences from his career journey and ask himself the question If I could go back 21 years in time and give my younger self some career advice, what would it be? Join him as he shares life lessons and stories that he has gathered through the years and his take on what he believes will be the most important human skills for the future of work.\u003c/p\u003e\u003cp\u003e&nbsp;\u003cb\u003eSpeaker Profile\u003c/b\u003e:&nbsp;He&nbsp;is an engineer by qualification, a developer by heart and a student for life. As the Employee Experience Leader for the IBM India Software Labs, he is responsible for leading business operations, skill transformation initiatives, engagement programs and building eminence within the Lab. While thats his role definition, He believes he is here to make IBM India Software Labs, a happy workplace. In his 21 years of product engineering experience, he has worked extensively on Operating Systems, Java Virtual Machine, Java Class Libraries, and Open Source Swift Foundation and led the Machine Learning Hub in the Lab.He&nbsp;is an avid storyteller and loves to catch up&nbsp;for&nbsp;conversations over a cup of coffee.\u003c/p\u003e\u003cbr\u003e\u003cb\u003eYT Link\u003c/b\u003e:&nbsp;\u003ca href=\"https://youtu.be/KW0Vh3LH5Mo\"\u003ehttps://youtu.be/KW0Vh3LH5Mo\u003c/a\u003e",
